window.bookSummaryJSON = "<p><i>Professional Football Steamy Romantic Comedy Box Set with Multicast Duet Narration!</i></p> <p><b>DECKER: Changing the Play</b> An <i>enemies-to-lovers workplace romance</i> between the <i>cocky quarterback and the owner</i> who just inherited the team. One of them used to be a bad boy with the words “panty” and “wrecker” in his nickname. One of them knows a lot about financial spreadsheets and nothing about football. But then legs get spread on sheets. Sparks fly. Banter banters. Can they both win this game without losing their hearts?</p> <p><b>DASH: Rushing the Play</b> Opposites attract and a <i>surprise pregnancy</i> brings a second chance for the <i>beast of a defensive end</i> to prove his dedication to the <i>ballerina beauty </i>who taught him grace. Hormones rage. Pecs dance. A baby is had and both new adults learn how to stay on point–together.</p> <p><b>DUKE: Faking the Play</b> A bookstore meet cute and a viral candid photo lead a <i>grumpy single dad placekicker</i> into a <i>fake relationship </i>with a <i>sassy sunshine British movie star</i>. Nicknames are given. Injuries are tended to. Weddings are attended. Until neither of them can pretend they don’t want a real happy ending with each other.</p> <p>Treat yourself to three funny, spicy full-length sports romance novels written by a dude who loves football and a chick who’s still trying to figure it out.</p> <p>**This collection contains three full length audiobooks, each with multicast duet narration.</p> <p>**DECKER is narrated by Connor Crais and Mackenzie Cartwright, featuring Ron Butler and Ava Lucas.</p> <p>DASH is narrated by Connor Crais and Emma Wilder, featuring Evan Parker and Mackenzie Cartwright.</p> <p>DUKE is narrated by Connor Crais and Desirée Ketchum, featuring Evan Parker and Mackenzie Cartwright.</p>"; 
